import React from "react";
import { HeroContainer, Image } from './Hero.styled';
import FarmImage from '../../../assets/farm.png'


const Hero = () => {
  <HeroContainer>
      <Image>
          <img src={FarmImage} alt="Logo" />
      </Image>
    
  </HeroContainer>
};

export default Hero;
